    # print(theseLetters) # a,b,c,d,e
    # print(nextLetters)  # f,g,h,i,j

    for j, ltr in enumerate(theseLetters):
        if misMatchCount > 1:
            break
        elif ltr == nextLetters[j]: #a, f
            commonLetters += ltr
        else:
            misMatchCount += 1


    if misMatchCount <= 1:
        print('Found the boxes!  The following have only one difference between them:')
        print(val)
        print(b_ids[startingIdx])
        print('The common letters are ' + commonLetters + '.')
        sys.exit()
